Конечно! Ниже приведена функция на Swift, которая принимает массив целых чисел, сортирует его в порядке возрастания и затем выводит отсортированный массив на экран:

```swift
import Foundation

// Функция для сортировки массива целых чисел и вывода его на экран
func sortAndPrintArray(of numbers: [Int]) {
    // Сортировка массива в порядке возрастания
    let sortedNumbers = numbers.sorted()

    // Вывод отсортированного массива на экран
    print(sortedNumbers)
}

// Пример использования:
let numbersArray = [5, 2, 9, 1, 3]
sortAndPrintArray(of: numbersArray)
```

Эта функция использует метод `sorted()` для сортировки массива в порядке возрастания. Метод `sorted()` возвращает новый отсортированный массив, не изменяя оригинальный массив. Затем функция просто выводит отсортированный массив на экран с помощью оператора `print()`.

Вы можете запустить эту функцию с любым массивом целых чисел, чтобы увидеть отсортированный результат.

Para leer la temperatura de los sensores DS18B20 en un ESP32 y enviar la información al monitor serial, puedes seguir estos pasos: oneWire bus y 1-Wire Serial Bus Interface (ISO14234-3) para comunicarse con los sensores.

Aquí tienes un ejemplo de código en C++ usando Arduino IDE, que necesitarás adaptar para el ESP32:

```cpp
#include <OneWire.h>
#include <DallasTemperature.h>

// Define el pino OneWire
#define ONE_WIRE_PIN 22

// Crear objeto OneWire y DallasTemperature
OneWire oneWire(ONE_WIRE_PIN);
DallasTemperature oneWireDallas( &oneWire );

void setup(void)
{
  Serial.begin(9600); // Iniciar serial a 9600 baudios
  oneWireDallas.begin(); // Iniciar el lector de temperatura
}

void loop(void)
{
  // Leer todas las unidades OneWire
  oneWireDallas.reset();
  oneWireDallas.selectDevice(0x24, 100); // Suponiendo que el ID del dispositivo sea 0x24

  // Leer la temperatura
  bool readResult = oneWireDallas.read();
  if (readResult) {
    Serial.print("Temperatura del sensor: ");
    Serial.println(oneWireDallas.getTempCByIndex(0)); // Obtener la temperatura del primer sensor
  } else {
    Serial.println("Error al leer la temperatura");
  }

  delay(2000); // Esperar 2 segundos antes de leer nuevamente
}
```

Aquí está lo que hace el código:

1. Incluye las bibliotecas necesarias `OneWire.h` y `DallasTemperature.h`.
2. Define el pino OneWire conectado al sensor DS18B20 (en este ejemplo, pino 22).
3. Crea un objeto `OneWire` y `DallasTemperature` para comunicarse con el sensor.
4. Inicia el serial en 9600 baudios en la función `setup()`.
5. En la función `loop()`, selecciona el sensor DS18B20 (suponiendo que su ID de dispositivo sea 0x24) y lee la temperatura.
6. Imprime la dirección del sensor y la temperatura leída en el monitor serial.
7. Espera 2 segundos antes de leer nuevamente la temperatura.

Asegúrate de que el ESP32 esté conectado a internet y que el puerto serial correspondiente esté configurado en tu IDE. Además, ajusta el ID del dispositivo (0x24 en este ejemplo) si tu sensor tiene un ID diferente.

