A continuación se muestra un ejemplo de implementación del algoritmo de ordenamiento por burbuja en C. El algoritmo de ordenamiento por burbuja funciona recorriendo repetidamente la lista, comparando elementos adyacentes y intercambiándolos si están en el orden incorrecto. Este proceso se repite hasta que la lista esté completamente ordenada.

```c
#include <stdio.h>

void swap(int *a, int *b) {
    int temp = *a;
    *a = *b;
    *b = temp;
}

void bubbleSort(int arr[], int n) {
    int i, j;
    for (i = 0; i < n-1; i++)     
        for (j = 0; j < n-i-1; j++)
            if (arr[j] > arr[j+1])
                swap(&arr[j], &arr[j+1]);
}

int main() {
    int arr[] = {64, 34, 25, 12, 22, 11, 90};
    int n = sizeof(arr)/sizeof(arr[0]);

    printf("Array antes de ordenar: \n");
    for (int i = 0; i < n; i++)
        printf("%d ", arr[i]);
    printf("\n");

    bubbleSort(arr, n);

    printf("Array después de ordenar: \n");
    for (int i = 0; i < n; i++)
        printf("%d ", arr[i]);
    printf("\n");

    return 0;
}
```

Este programa define una función `swap` para intercambiar dos valores y una función `bubbleSort` que realiza el ordenamiento por burbuja. La función `main` crea un array de ejemplo, llama a la función `bubbleSort` y luego imprime el array ordenado.

Recuerda que el ordenamiento por burbuja tiene una complejidad temporal de O(n^2), lo que lo hace ineficiente para conjuntos de datos grandes. En la práctica, se prefiere usar algoritmos de ordenamiento más eficientes como quicksort, mergesort o heapsort.

