```latex
x = \frac{-b \pm \sqrt{b^2 - 4ac}}{2a}
```

Para incluir esta fórmula en un documento LaTeX, puedes usar el siguiente código:

```latex
\documentclass{article}
\usepackage{amsmath} % Para el manejo de ecuaciones

\begin{document}

La fórmula de Bhaskara para resolver la ecuación de segundo grado $ax^2 + bx + c = 0$ se expresa como:
\begin{equation}
x = \frac{-b \pm \sqrt{b^2 - 4ac}}{2a}
\end{equation}

\end{document}
```

Este código utiliza el paquete `amsmath` para una mejor formateo de las ecuaciones. El resultado será un documento LaTeX con la fórmula de Bhaskara correctamente formateada y numerada.

